This behind the scenes shot is from the last "normal" wedding we had, way back in March. Almost 6 months ago now.

It's been 6 months of quarantining, postponing (and even cancelling) weddings, and trying to not break down as my industry (and so many others) struggle to survive. Part of me is like JUST SIX MONTHS? 

For the first month I still had normal work to do - an editing queue from jobs before the lockdown, an inbox full of emails about postponing in addition to the standard fare. The next couple months I stayed sane by staying busy. I conquered projects that had been on the back burner, I took time for education, I updated my website and my systems.

But then July & August hit. 

And they were a slog. I‚Äôm an anxious person by nature, but my anxiety was an extra high and brought its friend depression too (wahoo!). It was a hard summer. But I know I‚Äôm not alone in feeling that way and that helps. I read an article recently, I think on medium, about surge capacity depletion and I strongly recommend taking the time for it if you haven‚Äôt read it yet. We‚Äôre all dealing with an insane world right now. It‚Äôs fucking hard.

Anyway for my part, I think I‚Äôm coming out the other side of the darkness and am looking forward to a fall full of small weddings! How is everyone else holding up?";}i:30;a:1:{s:14:"comments_count";i:1;}i:31;a:1:{s:11:"likes_count";i:0;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEufEBLnwWn";}i:33;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118700812_2664980520439446_7862471330610981328_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=T3Y1ZSB0omQAX-wrW_H&_nc_tp=18&oh=b7b5bc5e91d7ea830ef602f8aaf61ac2&oe=5F7C6B79";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:1449845712;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2390984570800721729";}i:40;a:1:{s:10:"short_code";s:11:"CEue8yWBE9B";}i:41;a:1:{s:12:"created_time";i:1599247593;}i:42;a:1:{s:7:"caption";s:273:"Someone‚Äôs excited to be back on set tomorrow‚Ä¶
